import './App.css';
import axios from "axios";
import SearchField from "react-search-field";
import Results from "./components/Results";
import SearchResult from "./components/SearchResult";
import {Button, Col, Form} from "react-bootstrap";

function getImage(imageID) {
    return "https://www.artic.edu/iiif/2/" + imageID + "/full/843,/0/default.jpg"
}

function getUri(inputText) {
    return "https://api.artic.edu/api/v1/artworks/search?q=" + inputText
}

function App() {
  function sendRequest(inputText) {
      axios({
          method: 'get',
          url: getUri(inputText),
          responseType: 'json'
      }).then(
          response => {
              if(response.status === 200) {
                  console.log('data:', response.data)
              } else {
                  console.log('error:', response)
              }
          }
      )
  }

  return (
    <div className="App">
      <header className="App-header">
          <h1>Art Institute of Chicago Search</h1>
      </header>
        <div className="Body">
            <div>
                <Form>
                    <Form.Row className="d-flex align-items-end">
                        <Form.Group as={Col} controlId="formGridEmail">
                            <Form.Label>Email</Form.Label>
                            <Form.Control type="email" placeholder="Enter email" />
                        </Form.Group>

                        <Form.Group as={Col} controlId="formGridPassword">
                            <Form.Label>Password</Form.Label>
                            <Form.Control type="password" placeholder="Password" />
                        </Form.Group>

                        <Form.Group as={Col} controlId="formButton">
                            <Button>Submit</Button>
                        </Form.Group>
                    </Form.Row>
                </Form>
                <SearchField
                    placeholder="Search art by name, type, keyword, etc..."
                    onEnter={(val, event) => sendRequest(val)}
                    onSearchClick={(val) => sendRequest(val)}
                    searchText=""
                    classNames="search-field"
                />
            </div>
            <Results />
            <SearchResult />
        </div>
    </div>
  );
}

export default App;
